   "source": [
    "# Bikeshare Case Study\n",
    "## Introduction\n",
    "\n",
    "Dr. Carla Patalano and I created our own HR-related dataset, which is used in one of our graduate MSHRM courses called HR Metrics and Analytics. We use the data set to teach HR students how to use and analyze the data in Tableau Desktop - a data visualization tool that's easy to learn. This version provides a variety of features that are useful for both data visualization AND creating machine learning / predictive analytics models.\n",
    "\n",
    "### Objectives\n",
    "\n",
    "The objective is  to investigate employee turnover and absenteesim from 2008 to 2018. This will advise the Hr manager on reasons for turnover and abseentism an dhow to improve employee welfare\n",
    "\n",
    "## ASK\n",
    "The project seeks to examine the data acquired in order to get insights from the rate of turnover and absenteesim and the hiring methods of various employees. We are to offer recommendations for developing a company plan based on the findings.\n",
    "\n",
    "## PREPARE\n",
    "Data\n",
    "\n",
    "We have reduced the dataset's complexity to a single data file (v14). The CSV includes names, DOBs, age, gender, marital status, date of hiring, grounds for termination, department, if the employee is active or terminated, job title, pay rate, manager name, and performance score.\n",
    "Recent data additions include the following:\n",
    "*** Absences\n",
    "*** Most Recent Performance Review Date\n",
    "*** Employee Engagement Score\n",
    "\n",
    "## PROCESS\n",
    "It will be used since it can handle massive amounts of data. Moreover, data may be readily cleansed and displayed, facilitating analysis. The data were collected as a zip file before being converted to csv and submitted to R. The materials were submitted for additional review. \\ The information is presented in a tabular format with consistent column titles. Additionally, some column names were changed since they were unclear. The data type in the dates is inconsistent; the data appears in the wrong date format which is 'dd/mm/yy' but is really a character and in 'mm/dd/yy' format. As a result, the data type is modified to remedy the issue. In addition, the data types of the started at and ended at columns are specified.\n",
    "\n",
    "# Analysis\n",
    "STEP ONE\n",
    "Install packages"
   ]
  },
