    "#Remove bad data \n",
    "table(HR_DATA_$Turnover) # The dataframe includes a few hundred entries when bikes were taken out of docks and checked for quality by Divvy or ride_length was negative\n",
    "#creating a new data frame(v2) since data is being removed\n",
    "\n",
    "HRdata <- HR_DATA_[!(HR_DATA_$Turnover<0),]\n",
    "head(HRdata)\n",
    "Turnover <- HRdata[rowSums(is.na(HRdata))!= ncol(HRdata), ] #remove NA in rows and columns and create a new table \n",
    "\n",
    "head(Turnover)"
   ]
